import './App.css';
import Home from './pages/Home';
import New from './pages/New';
import { Routes, Route, useLocation } from 'react-router-dom';

function App() {
  const {pathName} = useLocation()
  return (
    <div className="App">
      <Home />
      <Routes>
        <Route index element={<Home/>}></Route>
        <Route path='/new' element={<New/>}></Route>
      </Routes>
    </div>
  );
}

export default App;
